import React, { useEffect, useState } from "react";
import "./style.css";
import { getPost, updatePost } from "../api";
import { useParams, useNavigate } from "react-router-dom";

function EditPost() {
  const { id } = useParams();
  const [title, setTitle] = useState("");
  const [description, setDescription] = useState("");
  const [content, setContent] = useState("");
  const [loading, setLoading] = useState(true);
  const [saving, setSaving] = useState(false);
  const [error, setError] = useState(null);
  const navigate = useNavigate();

  useEffect(() => {
    let mounted = true;
    getPost(id)
      .then((p) => {
        if (mounted && p) {
          setTitle(p.title || "");
          setDescription(p.description || "");
          setContent(p.content || "");
        }
      })
      .catch((err) => setError(err.message))
      .finally(() => setLoading(false));
    return () => (mounted = false);
  }, [id]);

  const handleSubmit = async (e) => {
    e.preventDefault();
    setSaving(true);
    setError(null);
    try {
      await updatePost(id, { title, description, content });
      navigate(`/posts/${id}`);
    } catch (err) {
      setError(err.message);
    } finally {
      setSaving(false);
    }
  };

  if (loading) return <main className="container">Загрузка...</main>;
  if (error) return <main className="container">Ошибка: {error}</main>;

  return (
    <>
      <header className="main-header">
        <div className="container">
          <a href="/" className="logo">ModernBlog</a>
          <nav className="main-nav">
            <a href="/">На главную</a>
          </nav>
        </div>
      </header>

      <main className="container">
        <h1 className="post-title">Редактировать пост</h1>
        <form onSubmit={handleSubmit}>
          <div className="form-group">
            <label htmlFor="title">Заголовок</label>
            <input
              type="text"
              id="title"
              name="title"
              className="form-control"
              value={title}
              onChange={(e) => setTitle(e.target.value)}
              required
            />
          </div>

          <div className="form-group">
            <label htmlFor="description">Краткое описание</label>
            <textarea
              id="description"
              name="description"
              rows="3"
              className="form-control"
              value={description}
              onChange={(e) => setDescription(e.target.value)}
              required
            />
          </div>

          <div className="form-group">
            <label htmlFor="content">Полное содержание</label>
            <textarea
              id="content"
              name="content"
              rows="12"
              className="form-control"
              value={content}
              onChange={(e) => setContent(e.target.value)}
              required
            />
          </div>

          {error && <p style={{ color: "red" }}>{error}</p>}
          <button type="submit" className="btn btn-primary" disabled={saving}>
            {saving ? "Сохранение..." : "Сохранить изменения"}
          </button>
        </form>
      </main>
    </>
  );
}

export default EditPost;
